Information
------------------------------

Hitler's Stealth Fighter
Top stealth-plane experts have re-created a radical, nearly forgotten Nazi aircraft: the Horten 2-29, a retro-futuristic fighter that arrived too late in World War II to make it into mass production the engineers' goal was to determine whether the so-called stealth fighter was truly radar resistant. In the process, they've uncovered new clues to just how close Nazi engineers were to unleashing a jet that some say could have changed the course of the war. To replicate the Ho 2-29 late last year for a, a team from the Northrop Grumman defense-contracting corporation used original Nazi blueprints and the only surviving Ho 2-29, which has been stored in a U.S. government facility for more than 50 years.

